import React from 'react'
import '../css/App.css'
import { Button, Form, FormGroup, Label, Input } from 'reactstrap';

class SignUp extends React.Component {

    render() {
        return (
            <Form className="login-form" onSubmit = {this.signup}>
                <h1 className="text-center" >Flight School</h1>
                <h2 className="text-center" >Sign Up</h2>

                <FormGroup>
                    <Label>Name</Label>
                    <Input type="text" placeholder="Name" />
                </FormGroup>

                <FormGroup>
                    <Label>Email</Label>
                    <Input type="email" placeholder="Email" />
                </FormGroup>

                <FormGroup>
                    <Label>Password</Label>
                    <Input type="password" placeholder="password" />
                </FormGroup>

                <Button className="btn-lrg btn-dark btn-block mt-3" onClick = {this.signup}>Sign Up</Button>

                <div className="text-center mt-3">
                    <a href="/">Cancel</a>
                </div>
            </Form>
        )
    }

    signup(e) {
        e.preventDefault();
        fire.auth().createUserWithEmailAndPassword(this.state.email, this.state.password).then((u) => {}).then((u) => { console.log(u) })
            .catch((error) => {
                console.log(error);
        })
    }
}

export default SignUp
